        </Layout>
    )
}

export async function getStaticPaths(){
    const blah = getPostIds();     
    return {
        paths:  blah,
        fallback: false
    }
}

export function getStaticProps({params}){
    console.log('fml');
    console.log(params.id);
    const blah = getPostContent(params.id);

    console.log(blah.content);
    return {
        props: {
            content: blah.content
        }
    }
}
